import React from 'react';
import './App.css';
import HomePage from './Pages/HomePage';
import AboutPage from './Pages/AboutPage';
import BlogsPage from './Pages/BlogPage';
import GalleryPage from './Pages/GalleryPage';

function App() {
  return (
    <div className="App">
      <HomePage />
      <AboutPage />
      <BlogsPage/>
      <GalleryPage/>
    </div>
  );
}

export default App;
